  [],\n\t\"revision_timestamp\": \"2016-07-06T05:43:12.045035\",\n\t\"name\": \"breeding-ecology-of-ferruginous-hawks-swainsons-hawks-and-northern-harriers-in-south-centr-a6c6f\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Final report of research survey to document
  the breeding ecology of ferruginous hawks, Swainsons hawk, and northern harrier
  in Kulm Wetland Management District WMD in southcentral North Dakota. This report
  contains objectives, accomplishemnts and analysis of data. Objectives for this survey
  are: 1 Using ground and aerial surveys, record all locations of nesting raptor species
  of interest ferruginous hawk, Swainsons hawk, and northern harrier in the study
  area. 2 Evaluate nest success, fledging success, and number of active nests for
  ferruginous hawk, Swainsons hawk, and northern harrier. 3 Quantify food habits associated
  with nest sites including regurgitated pellets, uneaten prey remains, and food delivered
  to young for ferruginous hawks, Swainsons hawks, and northern harriers. 4 Estimate
  mammalian prey species abundance, focusing on prey species documented as major prey
  items for ferruginous hawks, Swainsons hawks, and northern harriers. 5 Identify
  landscape characteristics associated with raptor nests by examining habitat characteristics
  at multiple spatial scales around each nest site, and evaluating how local and landscapelevel
  processes influence nesting patterns and overall reproductive success. 6 Estimate
  detection probabilities of raptors and nest occupancy through time, and model how
  landuse changes could influence population viability and sustainability. 7 Provide
  existing and preconstruction nesting and reproductive information relative to wind
  energy facilities in southcentral North Dakota.\",\n\t\"license_title\": \"License
